function isValid(x,y){
    return ((x >= 0 && x < 3) && (y >=0 && y < 3));
}

function move(position,direction){
    switch(direction){
        case 'U': return position <= 3 ? position : position-3;
        case 'D': return position >= 7 ? position : position+3;
        case 'L': return position % 3 == 1 ? position : position - 1;
        case 'R': return position % 3 == 0 ? position : position + 1;
    }
}

var input1 = ['ULL','RRDDD','LURDL','UUUUD'];
var input2 = ['',
            '',
            '',
            '',
            '']


function solution(input){
    let  result = ''
    input.reduce(((position,item)=>{
        position = Array.from(item).reduce((p,char)=>move(p,char),position);
        result+=position;
        return position;
    }),5);
 return result;
}


